import React from 'react';

export default function Dashboard({ stocks }) {
    return (
        <div className="dashboard-contents">
            <div className="">
                <label>Search By: </label>
                    <input placeholder='Stock# (4 digits)' maxLength={4} onChange={null}></input>
                    <label>Filter By: </label>
                    <select onChange={null}>
                        <option name="type" value="type1">type1</option>
                        <option name="type" value="type2">type2</option>
                        <option name="type" value="type3">type3</option>
                    </select>
            </div>

            {stocks.map((stock) => {
                const { image, name, type, quantity, supplier, inStock } = stock;  

                return (
                    <div>
                        <p>Displaying Dashboard component</p>
                        <ul>
                            <li>{name}</li>
                            <li>2</li>
                            <li>3</li>
                            <li>4</li>
                        </ul>
                    </div>
                );
            })}
        </div>
    )

};
